import React from 'react';
import './CaseStudySelectedProjects.css';

export function CaseStudySelectedProjects({ subtitle, projects }) {
  return (
    <section className="case-study-selected-projects">
      <div className="selected-projects-content">
        <h2>Selected projects</h2>
        <p className="projects-subtitle">{subtitle}</p>

        <div className="projects-grid">
          {projects.map((project, index) => (
            <div key={index} className="project-card">
              <img src={project.image} alt={project.title} />
              <h3>{project.title}</h3>
              <p>{project.description}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
